reviews:
['MichaelFebruary 2020We stayed at Guilherme’s place for 10 days in February. Here’s what you need to know:

Pros: 
Great location;
Lots of stores, restaurants, bars, and groceries nearby;
Safe neighborhood even when drunk at 2am;
Secure building;
Comfortable beds;
Good WiFi;
Nice TV with lots of channels (many in English);
Hot shower;
Fully equipped kitchen;
Easy check', 'in;
Excellent communication with host (although we never met him);
Basically everything was as described.

Cons:
The only negative I can think of is that during the day, there is always some kind of construction going on somewhere nearby. Afternoon naps not possible. But everything got quiet at night time. 

Overall: 5 stars.**', "**CarlosNovember 2019Nice apartment in Copacabana, it's very near cafes, supermarkets, bars and restaurants. It's about 10 minutes walking to Copacabana beach and about 30 to Ipanema. Amenities are sufficient, and apartment is well kept. Host communication was very good. Only issue we had was with the wifi (drops in connection), which host tried to fix very quickly.**", '**ArnoldJune 2019Amazing place and location . Thank you**', '**TerrellSeptember 2018Its a great loft..grocery store around the corner and restaurants ..five minutes from the beach...i had everything i needed...i had a small hot water/gas issue and Guilherme handled it in under two hours..he responds quick and very nice. i would have booked another week if someone had not beat me to it. You will enjoy this spot.**', '**JasonJune 2018Perfect apartment and location, awesome host. Modern apt with electronic key checkin.**', '**JoseMay 2018Cozy quiet place centralized to everything that you want, very attentive host courteous and informative. Definitely return visit is recommend one of those places you’ve got to go and experience. Cheers Brazil**', '**']
